import React, {useState} from 'react'

//MUI Stuff
import AppBar from '@material-ui/core/AppBar'
import Toolbar from '@material-ui/core/Toolbar'
import Button from '@material-ui/core/Button'
import { Link } from 'react-router-dom'
import Signup from '../pages/Signup'
import Login from '../pages/Login'

function Navbar(){

const [toggle, setToggle]= useState(true)

const handleToggleLogin=()=>{

     setToggle(false)
     setHideform(false)

}
const handleToggleSignup=()=>{

    setToggle(true) 
    setHideform(false)

}

return (
    <AppBar className='nav-container'>
        <Toolbar>
            <Button color="inherit"  component={Link} to='/' >Home</Button>

            <Button color="inherit"  onClick={handleToggleLogin} to='/login'>Login</Button>

            <Button color="inherit" onClick={handleToggleSignup} to='/signup'>Signup</Button>
            {toggle?
            <Signup />
            :
            <Login />}
        </Toolbar>
        <h1 className="header-text" >Urban Harvest</h1>
        <h2 className="no-waste">No waste is good waste.</h2>
    </AppBar>
)


}

export default Navbar
